        <http://vocab.getty.edu/aat/scopeNote/31740> <http://www.w3.org/1999/02/22-rdf-syntax-ns#value> "Refers to still images produced from radiation-sensitive materials (sensitive to light, electron beams, or nuclear radiation), generally by means of the chemical action of light on a sensitive film, paper, glass, or metal. Photographs may be positive or negative, opaque or transparent. The concept does not include reproductive prints of documents and technical drawings, for which descriptors found under \"<reprographic copies>\" are more appropriate. For digital photographs, generally prefer \"digital images.\""@en .
