        <http://vocab.getty.edu/aat/scopeNote/65568> <http://www.w3.org/1999/02/22-rdf-syntax-ns#value> "Se refiere a im\u00E1genes fijas producidas por materiales sensibles a la radiaci\u00F3n (sensibles a la luz, rayos de electrones o radiaci\u00F3n nuclear), generalmente por medio de la acci\u00F3n qu\u00EDmica de la luz sobre una pel\u00EDcula, papel, vidrio o metal sensible. No incluye impresiones de documentos reproductivos y dibujos t\u00E9cnicos, para los cuales los descriptores que se encuentran bajo \"&lt;copias reprogr\u00E1ficas&gt;\" son m\u00E1s apropiados. Las fotograf\u00EDas pueden ser en positivo o negativo, opacas o transparentes."@es .
